import { Card, Col } from 'react-bootstrap'

export default function ListingCard({element, index}) {
    const currentTime = new Date()

    function Title({ id, urls }) {

        let multipleUrls = false;

        if (urls.length > 1) {
            multipleUrls = true;
        }

        return (
            <Card.Title>
                <h5 className="d-inline pe-3">{id}</h5>
                <p className="d-inline" style={{fontSize: '10px'}}>{multipleUrls ? "(On multiple websites)" : "(Only on one website)"}</p>
            </Card.Title>
        )
    }

    return(
        <Col lg={3} md={6} key={index} className="pb-3 ps-2 pe-2 d-flex align-items-stretch">
            <Card className="w-100">
                <div className="image-wrapper">
                <div id='background-image' className="backgroundStyle" style={{backgroundImage: `url(${element[3]})`}} />
                </div>
                <Card.Body>
                    <Title id={element['_id']} urls={element['url']} />
                    <Card.Text>
                        {/* Price */}
                        <p>{element[2]}</p>
                        <p id="surface_area" className="d-inline pe-3 pb-2">{element[4]}</p>
                        <p id="number_of_rooms" className="d-inline pe-3 pb-2">{element[5]}</p>
                        <p id="furniture_status" className="d-inline pb-2">{element[6]}</p>
                        <a href={element[7]} className="d-block">{element[8]}</a>
                    </Card.Text>
                </Card.Body>
                <Card.Footer>
                <small className="text-muted">Last updated: {currentTime.toLocaleDateString()} at {currentTime.getHours()}:{currentTime.getMinutes()}</small>
                </Card.Footer>
            </Card>
        </Col>  
    )
}
